    HomepageComponent.prototype.disableUntil = function () {
        var d = new Date();
        d.setDate(d.getDate() - 1);
        var copy = this.getCopyOfOptions();
        copy.disableUntil = {
            year: d.getFullYear(),
            month: d.getMonth() + 1,
            day: d.getDate()
        };
        copy.disableSince = {
            year: d.getFullYear(),
            month: d.getMonth() + 4,
            day: d.getDate()
        };
        this.myDatePickerOptions = copy;
    };
    HomepageComponent.prototype.getCopyOfOptions = function () {
        return JSON.parse(JSON.stringify(this.myDatePickerOptions));
    };
    HomepageComponent.prototype.disableUntilSecond = function () {
        var d = new Date();
        d.setDate(d.getDate() - 1);
        var copy = this.getCopyOfOptionsSecond();
        copy.disableUntil = {
            year: d.getFullYear(),
            month: d.getMonth() + 1,
            day: d.getDate()
        };
        copy.disableSince = {
            year: d.getFullYear(),
            month: d.getMonth() + 4,
            day: d.getDate()
        };
        this.myDatePickerOptionsSecond = copy;
    };
    HomepageComponent.prototype.getCopyOfOptionsSecond = function () {
        return JSON.parse(JSON.stringify(this.myDatePickerOptionsSecond));
    };
    HomepageComponent.prototype.transform = function (url) {
        return this.sanitizer.bypassSecurityTrustResourceUrl(url);
    };
    HomepageComponent.prototype.datepick = function (val) {
        if (val.jsdate != null) {
            if (this.searchForm.value.returndate == null) {
                var d = new Date(val.jsdate);
                // d.setDate(d.getDate() - 1);
                var copy = this.getCopyOfOptionsSecond();
                copy.disableUntil = {
                    year: d.getFullYear(),
                    month: d.getMonth() + 1,
                    day: d.getDate()
                };
                copy.disableSince = {
                    year: d.getFullYear(),
                    month: d.getMonth() + 3,
                    day: d.getDate()
                };
                this.myDatePickerOptionsSecond = copy;
            }
            else {
                var d1 = new Date(val.jsdate);
                var d2 = new Date(val.jsdate + 1);
                // console.log((this.searchForm.value.returndate))
                if (val.jsdate >= this.searchForm.value.returndate.jsdate) {
                    // console.log(d1.getDate() + 1)
                    this.searchForm.patchValue({
                        returndate: {
                            date: {
                                year: d1.getFullYear(),
                                month: d1.getMonth() + 1,
                                day: d1.getDate() + 1
                            },
                            jsdate: d2
                        }
                    });
                }
                // d.setDate(d.getDate() - 1);
                var copy = this.getCopyOfOptionsSecond();
                copy.disableUntil = {
                    year: d1.getFullYear(),
                    month: d1.getMonth() + 1,
                    day: d1.getDate()
                };
                copy.disableSince = {
                    year: d1.getFullYear(),
                    month: d1.getMonth() + 3,
                    day: d1.getDate()
                };
                this.myDatePickerOptionsSecond = copy;
            }
        }
    };
